import React, { FC, Suspense, lazy, useState } from 'react'
import styles from './button.module.css'
import { Link, Route } from 'react-router-dom'

const PopupTweet = lazy(() => import('../../../PopupTweet/PopupTweet'))

type props = {
  SetPostNews: any
}

export const Button: FC<props> = React.memo(({ SetPostNews }) => {
  const [popup, setPopup] = useState(false)

  const onClick = () => setPopup((prev) => !prev)

  const suspension = () => {
    return (
      <Suspense fallback={<div>Loading...</div>}>
        <Route path="/popup" component={() => <PopupTweet SetPostNews={SetPostNews} />} />
      </Suspense>
    )
  }

  return (
    <>
      {/* <Link to="/popup" className={styles.btnFont} data-testid="testBtn">
        Tweet
      </Link> */}
      {/* <Suspense fallback={<div>Loading...</div>}>
        <Route path="/popup" component={() => <PopupTweet SetPostNews={SetPostNews} />} />
      </Suspense> */}

      <button type="button" className={styles.btnFont} data-testid="testBtn" onClick={onClick}>
        {Tweet && popup ? suspension : null}
      </button>
    </>
  )
})
